import React from "react";

const Plus = () => {
  return(
    <>
      <div className = "page_div">
        <div className = "center_div">
          <h1>Enter Your Name To get Amazing Avatar for you</h1>
          <input type = "text" placeholder = "Enter Your Name"/>
        </div>
      </div>
    </>
  );
}

export default Plus;
